INSERT INTO `v9_news_data` VALUES ('22', '<p>&nbsp;</p>\r\n<p style=\"TEXT-INDENT: 2em\">&nbsp;</p>\r\n<p align=\"center\"><img alt=\"台湾围棋混血美女获三星杯外卡 或为推广需要\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903120654206.jpg\" /></p>\r\n<p align=\"center\" style=\"FONT-FAMILY: 宋体; FONT-SIZE: 10pt\">黑嘉嘉</p>\r\n<p style=\"TEXT-INDENT: 2em\">腾讯体育讯 近日据韩媒报道，23岁的中国台北美女棋手黑嘉嘉获得今年三星杯外卡，这是三星杯举办22届比赛以来首次向中国台北棋手颁发外卡，韩国猜测这是三星杯为推广赛事做出的选择。黑嘉嘉也成为三星杯历史上第二位女子外卡棋手，2001年第六届三星杯，当时的旅韩棋手芮乃伟获得外卡参赛，芮乃伟在那届三星杯比赛中打进了八强。</p>\r\n<p style=\"TEXT-INDENT: 2em\">今年三星杯预赛黑嘉嘉参加过女子组比赛，但未能出线。黑嘉嘉2008年14岁的时候在大陆定段成功，2010年10月晋升二段。2011年1月，晋升五段成为台湾有史以来段位最高的职业女棋手。2012年5月又晋升为职业六段。2010年她代表中国台北参加广州亚运获得围棋女子团体铜，同年她在兵圣杯世界女子赛上收获亚军。2013年在首届梦百合杯预选赛中，黑嘉嘉连过三关成功突围晋级本赛。</p>\r\n<p style=\"TEXT-INDENT: 2em\">黑嘉嘉的父亲是澳大利亚人，母亲则来自中国台湾，黑嘉嘉的中文姓氏即是随母亲黑南萍，黑家祖先在河南邓州市赵集乡黑白洼村。黑嘉嘉的最新世界排名是第496位，韩媒分析说三星杯为她颁发外卡目的是借助她美女棋手的身份，来推广赛事聚集人气。</p>\r\n<p style=\"TEXT-INDENT: 2em\">在过去21届三星杯比赛里，韩国棋手12次夺冠中国棋手7次夺冠，日本棋手有两次夺冠纪录。中国的世界围棋第一人柯洁，在2015、2016两届三星杯决赛中分别战胜队友时越、柁嘉熹两次夺冠。三星杯历史上曾出现过外卡棋手夺冠的奇迹，2003年第八届三星杯，韩国旅日棋手赵治勋以外卡身份最终登顶。不过过去21届比赛的21位外卡棋手，也有15人32强战首轮就输棋出局，包括上届外卡棋手中国名将古力、2014以及2015外卡棋手李昌镐，都是止步32强。</p>\r\n<p style=\"TEXT-INDENT: 2em\">本届三星杯32强双败淘汰赛，将于9月5-7日在韩国京畿道高阳市三星火灾国际校园举行。16强、8强赛将于9月25-27日在韩国大田进行，半决赛三番棋将于11月6-8日举行，决赛三番棋比赛将于12月5-7日进行。本届三星杯总奖金8亿韩元，冠军奖金3亿韩元（约177万人民币）、亚军1亿韩元（约59万人民币）。比赛用时每方2小时5次1分钟读秒，没有午休。（陈雒城）</p>\r\n<p style=\"TEXT-INDENT: 2em\"><strong>2017年第22届三星杯参赛阵容：</strong></p>\r\n<p style=\"TEXT-INDENT: 2em\">中国13人：柯洁、柁嘉熹、范蕴若、唐韦星、陈耀烨(免选) 、童梦成、辜梓豪、赵晨宇、薛冠华、李维清、杨鼎新、陈梓健、李赫</p>\r\n<p style=\"TEXT-INDENT: 2em\">韩国14人：李世石、朴永训、朴廷桓、安国铉、申真谞(免选)、宋泰坤、朴进率、安成浚、韩态熙、卞相壹、李东勋、申旻埈、徐奉洙、金彩瑛</p>\r\n<p style=\"TEXT-INDENT: 2em\">日本3人：井山裕太、山下敬吾(免选)、小松英树</p>\r\n<p style=\"TEXT-INDENT: 2em\">波兰1人：马特乌斯苏尔玛</p>\r\n<p style=\"TEXT-INDENT: 2em\">外卡1人：黑嘉嘉（中国台湾）</p>\r\n<p>&nbsp;</p>\r\n', '0', '', '0', '10000', '', '0', '', '0', '1', '|0');
INSERT INTO `v9_news_data` VALUES ('23', '<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012649736.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>原标题：泰国环球小姐出炉！通晓5国语混血美女玛莉亚夺冠</p>\r\n<p>综合星岛环球网消息 2017年泰国环球小姐（Miss Universe Thailand）大赛结果出炉，今年度的后冠由25岁的混血佳丽玛莉亚（Mareeya Poonlertlarp）夺得，她将代表泰国前往美国参加世界环球小姐大赛。这位美女拥有泰国和瑞典混血，不仅拥有美丽的外表，更是一名高材生。毕业于瑞典斯德哥尔摩商学院，身高184公分，7年前曾出过一张唱片，目前是一名模特，还通晓泰语、瑞典语、英语、越南语和汉语5种语言。</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012652233.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>佳丽玛莉亚夺冠后，除了获2017泰国环球小姐之称，还将获得100万泰铢的奖金、钻石后冠以及一辆汽车，并将代表泰国于11月前往美国赌城拉斯维加斯，和全世界佳丽一同角逐国际环球小姐的殊荣。泰国曾于1988年，由当年的代表蓬堤普夺下国际大赛后冠，是至今为止最佳的成绩；去年的代表恰丽塔，则是在国际大赛中闯入前六强，让外界很关注，今年的玛莉亚能为泰国拿回怎样的成绩，值得期待。</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012653429.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>作为国际三大选美比赛之一，&ldquo;环球小姐&rdquo;的知名度，相对来说仍比&ldquo;国际小姐&rdquo;和&ldquo;世界小姐&rdquo;略高一筹。从1952年开始举办，至今已走过65个年头，60年代开始向全球直播，1972年起正式离开美国本土、前往全球各地举办大赛，今年1月第65届就选择了热情的菲律宾海滩，并且由23岁法国小姐艾瑞丝（Iris Mittenaere），夺下法国自1953年来首座&ldquo;环球小姐&rdquo;后冠。环球小姐大赛与现任美国总统特朗普亦有关联，自1996年开始，他和他的地产集团接手举办这项比赛至今，也因此引发在选举期间与前任环球小姐公开互骂的闹剧。&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012654700.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012659158.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012659867.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012700791.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012702887.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012703807.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012703431.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012704568.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012705270.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012705295.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012706246.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012706744.jpeg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"detailPic\"><img alt=\"\" src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012707848.jpeg\" /><span class=\"ifengLogo\"><a href=\"http://www.ifeng.com/\" target=\"_blank\"><img src=\"http://www.mmiou.cc/uploadfile/2017/0903/20170903012707281.png\" /></a></span></p>\r\n', '0', '', '0', '10000', '', '0', '', '0', '1', '|0');
