INSERT INTO `v9_news_data` VALUES ('35', '<p>随着时代变迁，现代人的压力更加沈重，又因为求学、工作等原因越来越晚婚，甚至抱持不婚主义，成家立业不再是必要的选择。为此日本一家媒体实际到街头，并访问300位20到30岁未婚的男性，探究他们的内心动机。究竟~~这些男生「不想结婚」的理由是什么？小百合也好想知道喔~~</p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011452602.jpg\" /></p>\r\n<p>这项调查发现，现代人越来越晚婚，甚至有41.7%的男性认为，就算一辈子不结婚也没关系，为什么他们不想踏入婚姻？大致的原因有以下几点：</p>\r\n<p>一、「没有把握能爱同一个女人一辈子」</p>\r\n<p>爱情说来就来、说走就走，随时都可能对身边的那个人失去感觉&hellip;事实上，许多夫妻在结婚多年之后，相互的爱情早消失了，剩下的只是习惯和亲情</p>\r\n<p>二、「不喜欢和别人住在一起」</p>\r\n<p>每个人生活都有自己的习惯和坚持，两个来自不同背景的人住在一起必会出现很多磨擦，需要一段时间来磨合和适应。这也是为什么结婚前要先同居的意涵</p>\r\n<p>三、「找不到喜欢自己的人」</p>\r\n<p>许多日本网友认为，自己不是高富帅、也不是富二代，根本没有女生会看上自己。在小百合看来，这好像有点太悲伤了，相信还是有女孩不这么在乎外表、重视内在的啊~~</p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011453603.jpg\" /></p>\r\n<p>四、「没有遇到让自己有结婚冲动的女友」</p>\r\n<p>找不到符合心中条件的女友，或是过去的女友还不够优，甚至有些人觉得，即使不结婚也没什么差，所以就懒了&hellip;</p>\r\n<p>五、「找结婚对象很麻烦」</p>\r\n<p>老婆是要相处一辈子的，当然要好好选啦。对许多人来说，找到个性契合的另一半实在很惨，不然未来相处有问题时，要离婚也会更加麻烦！另一些人则认为男人是家庭主要的经济支柱，如果薪水不够，当然不敢轻易结婚啦。</p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011454604.jpg\" /></p>\r\n<p>六、「最重要的是...一个人自由自在」</p>\r\n<p>不用被老婆管、不用顾虑家庭，想做什么就能做什么。而且结婚以后，男人的薪水就要交给老婆，花在家庭、小孩身上，没有多余闲钱可以自己花，爽度当然是降低不少。文／小百合</p>\r\n', '0', '', '0', '10000', '', '0', '', '0', '1', '|0');
INSERT INTO `v9_news_data` VALUES ('36', '<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011455605.jpg\" /></p>\r\n<p>如果有个妹子在淋浴间半脱比基尼一边沖水一边挑逗，那狼哥一定二话不说直接喊 play one 啊！这是由强国摄影师 臭阿熊 带来的作品，完美呈现出男人幻想女人湿身诱惑的情景，而且在狭小的空间之中只有妳我两人，等会儿绝对让地上再多一摊水！</p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011456606.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011457607.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011458608.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011458609.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011458610.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011459611.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011500612.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011500613.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011500614.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011501615.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011502616.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011503617.jpg\" /></p>\r\n<p><img src=\"http://www.mmiou.cc/uploadfile/2017/1019/20171019011504618.jpg\" /></p>\r\n<p>我知道大大们看到这里大概也清枪完毕了，等等付上摄影师的传送门，以后还有更多作品可以欣赏喔！</p>\r\n<p>摄影师-臭阿熊</p>\r\n<p>文/荒野一匹狼</p>\r\n', '0', '', '0', '10000', '', '0', '', '0', '1', '|0');
